import React, { useState, useEffect } from 'react';
import { Modal, Button, Form } from 'react-bootstrap';

const AddEditProductModal = ({ show, handleClose, handleSave, initial, categories = [], suppliers = [] }) => {
  const [form, setForm] = useState({
    product_Name: '',
    category_ID: '',
    supplier_ID: '',
    price: '',
    product_Quantity: ''
  });

  useEffect(() => {
    setForm(initial ? {
      product_Name: initial.product_Name || '',
      category_ID: initial.category_ID || '',
      supplier_ID: initial.supplier_ID || '',
      price: initial.price || '',
      product_Quantity: initial.product_Quantity || ''
    } : {
      product_Name: '',
      category_ID: '',
      supplier_ID: '',
      price: '',
      product_Quantity: ''
    });
  }, [initial]);

  const onChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const onSave = () => {
    handleSave(form);
    setForm({
      product_Name: '',
      category_ID: '',
      supplier_ID: '',
      price: '',
      product_Quantity: ''
    });
  };

  return (
    <Modal show={show} onHide={handleClose} centered>
      <Modal.Header closeButton>
        <Modal.Title>{initial ? 'Edit' : 'Add'} Product</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form>
          <Form.Group className="mb-2">
            <Form.Label>Product Name</Form.Label>
            <Form.Control name="product_Name" value={form.product_Name} onChange={onChange} />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Category</Form.Label>
            <Form.Select name="category_ID" value={form.category_ID} onChange={onChange}>
              <option value="">Select Category</option>
              {categories.map(cat => (
                <option key={cat.category_ID} value={cat.category_ID}>{cat.category_Name}</option>
              ))}
            </Form.Select>
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Supplier</Form.Label>
            <Form.Select name="supplier_ID" value={form.supplier_ID} onChange={onChange}>
              <option value="">Select Supplier</option>
              {suppliers.map(sup => (
                <option key={sup.supplier_ID} value={sup.supplier_ID}>{sup.supplier_Company}</option>
              ))}
            </Form.Select>
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Price</Form.Label>
            <Form.Control name="price" type="number" value={form.price} onChange={onChange} />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Quantity</Form.Label>
            <Form.Control name="product_Quantity" type="number" value={form.product_Quantity} onChange={onChange} />
          </Form.Group>
        </Form>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>Cancel</Button>
        <Button variant="primary" onClick={onSave}>Save</Button>
      </Modal.Footer>
    </Modal>
  );
};

export default AddEditProductModal;
